// frontend/src/UserForm.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { io } from 'socket.io-client';

const socket = io('http://localhost:5000');

function UserForm({ addFriend }) {
  const [name, setName] = useState('');
  const [hometown, setHometown] = useState('');
  const [mbti, setMbti] = useState('');
  const [hobby, setHobby] = useState('');
  const [favoriteFood, setFavoriteFood] = useState('');

  useEffect(() => {
    socket.on('connect', () => {
      console.log('サーバーに接続しました');
    });

    return () => {
      socket.disconnect();
    };
  }, []);

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://localhost:5000/api/users', { name, hometown, mbti, hobby, favoriteFood });
      addFriend(response.data);
      socket.emit('join', response.data);
      // フォームのリセット
      setName('');
      setHometown('');
      setMbti('');
      setHobby('');
      setFavoriteFood('');
    } catch (error) {
      console.error('ユーザーの作成に失敗しました:', error);
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <div>
        <label>名前:</label>
        <input type="text" value={name} onChange={(e) => setName(e.target.value)} required />
      </div>
      <div>
        <label>出身地:</label>
        <select value={hometown} onChange={(e) => setHometown(e.target.value)} required>
          <option value="">選択してください</option>
          <option value="東京">東京</option>
          <option value="大阪">大阪</option>
          <option value="愛知">愛知</option>
          <option value="福岡">福岡</option>
          <option value="北海道">北海道</option>
          <option value="宮城">宮城</option>
          <option value="広島">広島</option>
        </select>
      </div>
      <div>
        <label>MBTIタイプ:</label>
        <select value={mbti} onChange={(e) => setMbti(e.target.value)} required>
          <option value="">選択してください</option>
          <option value="INTJ">INTJ</option>
          <option value="INTP">INTP</option>
          <option value="ENTJ">ENTJ</option>
          <option value="ENTP">ENTP</option>
          {/* 必要に応じて他のMBTIタイプも追加 */}
        </select>
      </div>
      <div>
        <label>趣味:</label>
        <select value={hobby} onChange={(e) => setHobby(e.target.value)} required>
          <option value="">選択してください</option>
          <option value="アウトドア">アウトドア</option>
          <option value="インドア">インドア</option>
        </select>
      </div>
      <div>
        <label>好きな食べ物:</label>
        <select value={favoriteFood} onChange={(e) => setFavoriteFood(e.target.value)} required>
          <option value="">選択してください</option>
          <option value="焼肉">焼肉</option>
          <option value="寿司">寿司</option>
          <option value="お好み焼き">お好み焼き</option>
        </select>
      </div>
      <button type="submit">送信</button>
    </form>
  );
}

export default UserForm;
